import React from 'react';
import './Sobre.css';
import Navbar from '../Components/Navbar'; // usa a tua navbar existente

const Sobre = () => {
  return (
    <div>
      <Navbar />
      <main className="sobre-content">
        <div className="sobre-caixa">
          <p>
            Este projeto foi desenvolvido no âmbito do projeto final da Licenciatura em Engenharia Informática e de Computadores da Escola Superior Náutica Infante D. Henrique.
          </p>
          <p>
            Tem como objetivo principal o desenvolvimento de uma estação meteorológica que permita a recolha de dados meteorológicos em tempo real, bem como a sua visualização através de uma aplicação web.
          </p>
          <p>
            A estação meteorológica desenvolvida é composta por um conjunto de sensores que permitem a medição de parametros como temperatura, humidade, pluviosidade, velocidade do vento, direção do vento,
            este projeto utiliza diversas tecnologias, incluindo I2C, MQTT, LoRa, Node-RED, React, Leaflet  e Flask 
          </p>
        </div>
      </main>
    </div>
  );
};

export default Sobre;
